function goodSubsetofBinaryMatrix(grid: number[][]): number[] {
    let bestSubset: number[] = [];
    for (let mask = 1; mask < (1 << grid.length); mask++) {
        let subset: number[] = [], columnSums = new Array(grid[0].length).fill(0), isValid = true;
        for (let row = 0; row < grid.length; row++) {
            if ((mask & (1 << row)) !== 0) {
                subset.push(row);
                for (let col = 0; col < grid[0].length; col++) {
                    columnSums[col] += grid[row][col];
                }
            }
        }
        for (let sum of columnSums) {
            if (sum > Math.floor(subset.length / 2)) {
                isValid = false;
                break;
            }
        }
        if (isValid && subset.length > bestSubset.length) {
            bestSubset = subset;
        }
    }
    return bestSubset;
}
